import ReactDOM from "react-dom";
import ContextAiOwl from './ContextAiOwl'
import App from "./App";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <ContextAiOwl>
        <App />
    </ContextAiOwl>
  </React.StrictMode>,
  rootElement
);
